description:
Nell (Justine Joli) has a wonderful business; she teaches women how to kiss, but she can't do the job alone. So with the help of her beautiful assistant Katy (AJ Applegate) and kisser trainee Rose (Sinn Sage), the three women kiss their way into the hearts of all the single girls and LTR couples that come to their Girls Kissing Girls seminar weekend. With: Dana DeArmond, Misty Stone, August Ames, Ryan Ryans &amp; Anastasia Morna.

August Ames,Ryan Ryans,A.J. Applegate,Dana DeArmond,Anna Morna,Sinn Sage,Misty Stone,Justine Joli

